import React from "react";

class InputTimer extends React.Component {
  constructor() {
    this.state = {
      minutes1: 0,
      minutes2: 0,
      seconds1: 0,
      seconds2: 0,
    }
  }

  handleChange({ target }) {
    const name = target.name;
    const value = target.value;
    this.setState({
      [name]: value,
    })
  }
  render() {
    return (
      <label>
          <input type="number" />
          <input type="number" />
          <input type="number" />
          <input type="number" />
          </label>
    );
  }
}

export default InputTimer;
